    np=base;
    for(i=59;i>=0;i--){
      c=0;
      for(j=0;j<n;j++){
        w=(x[j]-base)%3;
        l=cval-x[j]-y[j];
        //[領域の始点,領域の終点]
        rgdigdp(l,np-x[j],np+(1ll<<i)-1-x[j],get);
        c+=get[(3+bm-w)%3];
        c%=2;
      }
      //printf("%lld:%lld %lld\n",i,c,d);
      if(c==0){
        np+=(1ll<<i);
      }
    }
    bx=np;by=cval-bx;
    if(findcol(bx,by)==0){
      printf("<%lld %lld>\n",bx,by);
      return -1;
    }
    lx=bx;
    hx=bx;
    for(i=60;i>=0;i--){
      w=(1ll<<i);
      if(findcol(lx-w,cval-(lx-w))==1){
        lx-=w;
      }
      if(findcol(hx+w,cval-(hx+w))==1){
        hx+=w;
      }
    }
    printf("%lld %lld\n",lx,cval-hx);
